import DarkVariantExample from './comoponet/slider';
import ContainerExample from './comoponet/card';
import ContainerExample2 from './comoponet/team';
import ContainerExample3 from './comoponet/aboout';
import ContainerExamples from './comoponet/footer';

//css
import 'bootstrap/dist/css/bootstrap.min.css';
//bootstrap
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
  return (
   <div className="App">
        <NavScrollExample/>
      <DarkVariantExample/>
      <br></br>
      <ContainerExample/>
<ContainerExample2/>
<ContainerExample3/>
<ContainerExamples/>
    </div>
  );
}

export default App;
